import React from "react";
import { PageMain } from "core";
import NotificationSystem from "react-notification-system";
import RequestListSection from "../sections/customerInfo/requestListSection";

class RequestListPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {};
    this.notificationSystem = React.createRef();
  }
  
  render() {
    return (
      <PageMain
        title="فهرست درخواست ها"
        icon="list-details"
        context={this}
        footerLinks={[
          { href: "/", text: "صفحه اصلی" },
          { href: "https://banksepah.ir", text: "وب سایت رسمی بانک سپه" },
        ]}>
        <RequestListSection />
        <NotificationSystem ref={ this.notificationSystem } />
      </PageMain>
    );
  }
}

export default RequestListPage;
